import React from 'react';
import './App.css';

function App() {
  return (
    <main>
      <header>
        <a href='#logo' className='logo'>My Blog</a>
        <nav>
          <a href='#login'>Log in</a>
          <a href='#register'>Register</a>
        </nav>
      </header>
      <div className='entry'>
        <img src='https://i.kinja-img.com/gawker-media/image/upload/c_fit,f_auto,g_center,q_60,w_1315/dde58e70727aad7c96e348ce79b3ca2b.jpg' alt='mario' />
        <h1>
          Super Mario Bros. Wonder Is A Whole New Approach To 2D Mario Games
        </h1>
        <h2>
          The Nintendo Switch side-scroller will include asynchronous online 
          co-op, brand-new enemies, hilarious abilities, and more
        </h2>
      </div>
    </main>
  );
}

export default App;
